import React from "react";
import { ReactComponent as Star } from "../assets/star.svg";

const ART_DETAILS = {
  image: "Artwork Image Here",
  title: "Artwork Name Here",
  location: "On View At (location)",
  artist: "Artist",
  date: "Date",
  period: "Period",
  culture: "Culture",
  medium: "Medium",
  about: "About",
  resources: "Resources",
  rating: 0,
};

function ArtworkDetails() {
  return (
    <div className="main">
      <div className="left-side">
        <div className="artwork-image"> {ART_DETAILS.image} </div>
        <div className="rating">
          {[1, 2, 3, 4, 5].map((star) => (
            <Star
              key={star}
              size={32}
              className={`${
                star <= ART_DETAILS.rating
                  ? star === 2
                    ? "fill-red-500 text-red-500"
                    : star === 3
                    ? "fill-yellow-400 text-yellow-400"
                    : "fill-green-500 text-green-500"
                  : "text-gray-300"
              }`}
            />
          ))}
        </div>
      </div>
      <div className="right-side">
        <div className="artwork-title"> a</div>
        <div className="artwork-location"></div>
        <div className="artwork-info">
          <div className="artwork-artist"></div>
          <div className="artwork-date"></div>
          <div className="artwork-period"></div>
          <div className="artwork-culture"></div>
          <div className="artwork-medium"></div>
          <div className="artwork-about"></div>
          <div className="artwork-resources"></div>
        </div>
      </div>
    </div>
  );
}

export default ArtworkDetails;
